import React from 'react';
import {BrowserRouter as Router, Route} from 'react-router-dom';
import './App.css';
import chefOnboarding from './ChefLogin';

function App() {
  return (
    <div className="App">
      <chefOnboarding />
      <Router>
        <Route exact path='/' component={chefOnboarding} />
      </Router>
    </div>
  );
}

export default App;
